function Standout() {
    return(
        <article className="info-section">
            <div className="transform-section-img" />
            <section>
                <h2>
                    Stand out to the right audience
                </h2>
                <p>
                Using a collaborative formula of designers, videographers, and copywriters,
//                     we’ll build and extend your brand in digital places.
                </p>
                <a href="/">Learn more</a>
            </section>
        </article>
    );
}

export default Standout;

